 import React from 'react';
 import 'SearchBar.css';

    class SearchBar extends React.Component {
        render() {
            return (
                <div>
                    <form className="SearchBox">
                        <label><h2> Search </h2></label>
			<input className="inputStyle" type="text" />
                    </form>
                </div>
            )
        }
    }

    export default SearchBar;
